import { BrowserRouter, Navigate , Routes , Route} from "react-router-dom";
import { Signup } from "./components/Signup.js";

function Login(){
    return(
        <BrowserRouter>
        <Routes>
        <switch>
          <Route path="/Signup" >
          <Signup />
          </Route>
          </switch>
        </Routes>
      </BrowserRouter>
    )
}

export default Login;
